function addCSSFile(url) {
    var adlito_head = document.head;
    var adlito_csslink = document.createElement("link");
  
    adlito_csslink.type = "text/css";
    adlito_csslink.rel = "stylesheet";
    adlito_csslink.href = url;
  
    adlito_head.appendChild(adlito_csslink);
  }
  addCSSFile("https://adlitoui.netlify.app/iframepage/res/iframepage.css");
  addCSSFile("https://adlitoui.netlify.app/cards/res/cards.css");
  addCSSFile("https://adlitoui.netlify.app/buttonUI/res/buttonUI.css");
  addCSSFile("https://adlitoui.netlify.app/form/res/forms.css");
  addCSSFile("https://adlitoui.netlify.app/fonts/zx-fonts.css");
  addCSSFile("https://adlitoui.netlify.app/styleUI/adb-background.css");
  addCSSFile("https://adlitoui.netlify.app/styleUI/adb-Ccolor.css");
  addCSSFile("https://adlitoui.netlify.app/styleUI/animations.css");
  addCSSFile("https://adlitoui.netlify.app/styleUI/short.css");


var adlito_fontawesome = document.createElement("script");
adlito_fontawesome.src = "https://kit.fontawesome.com/80b6b65415.js";
document.head.appendChild(adlito_fontawesome);

var adlito_adex = document.createElement("script");
adlito_adex.src = "https://adlitoui.netlify.app/js/adex.min.js";
document.head.appendChild(adlito_adex);
var adlito_nadex = document.createElement("script");
adlito_nadex.src = "https://adlitoui.netlify.app/js/nadex.min.js";
document.head.appendChild(adlito_nadex);

function addjsFile(urljs) {
  var adlito_jsrc = document.createElement("script");
  adlito_jsrc.src = urljs;

  document.body.appendChild(adlito_jsrc);
}

document.addEventListener("DOMContentLoaded", function() {
  addjsFile("https://adlitoui.netlify.app/iframepage/res/iframepage.js");
});

